import { useState, useCallback, Dispatch, useEffect } from "react";
import {
    TextField,
    FormControl,
    InputLabel,
    MenuItem,
    FormHelperText,
    Select,
    Button,
    Icon,
    RadioGroup,
    FormControlLabel,
    Radio,
    colors,
} from "@mui/material";
import AvatarBigImage from './../../../assets/images/mettler_images/AvatarBigImage.png';
import HIPAAComplianceContainer from "./../../../components/HIPAAComplianceContainer";
import "./../Bed/BedMasterConfiguration.css";
import React from "react";
import { connect } from "react-redux";
import bottomImage from './../../../assets/images/mettler_images/bg.svg';
import newImage from './../../../assets/images/mettler_images/rectangle-5999.svg';
import BedMasterConfigurationData from "./../../../assets/data/BedMasterConfigurationData.json";
import { createBedAssignment, getAllBedAssignment } from "../../../store/actions/BedAssignment";
import * as Constants from "./../Constants/ConstantValues";
import SecondaryButton from "../../../components/SecondaryButton";
import PrimaryButton from "../../../components/PrimaryButton";
import "../../../components/BottomFooter.css";
import { HttpLogin } from "../../../utils/Http";
import { DatePicker, LocalizationProvider } from "@mui/x-date-pickers";
import { AdapterDateFns } from "@mui/x-date-pickers/AdapterDateFns";
import bloodBag from './../../../assets/images/mettler_images/blood_bag.svg';
import bloodDrop from './../../../assets/images/mettler_images/blood_drop.svg';
import bloodDropNew from './../../../assets/images/mettler_images/blood_dropNew.svg';
import bloodDropNewOne from './../../../assets/images/mettler_images/blood_dropNewOne.svg';

import AvatarDoctorImage from './../../../assets/images/mettler_images/AvatarDoctor.png';


interface IAddProcedurey { }
interface IAddProcedure {
    StaticPage: any;
    dispatch: Dispatch<any>;
    createOrganizationData: any;
    errorMessage: any;
    state: {
        nodes: [],
        checked: [],
        expanded: []
    }
}
const AddProcedure: React.FC<IAddProcedure> = ({
    dispatch, createOrganizationData, errorMessage


}) => {


    let [inputFormData, setInputFormData] = useState(BedMasterConfigurationData);
    let [organizationId, setOrganizationId] = useState("");
    let [floorNumber, setFloorNumber] = useState(null);
    let [wingData, setWingData] = useState(null);
    let [wardNumber, setWardNumber] = useState(null);
    let [sideData, setSideData] = useState(null);
    let [roomNumber, setRoomNumber] = useState(null);
    let [bedTypeData, setBedTypeData] = useState(null);
    let [bedNumber, setBedNumber] = useState(null);
    let [supervisionLevelData, setSupervisionLevelData] = useState(null);
    let [positionData, setPositionData] = useState(null);
    let [positionIndex, setPositionIndex] = useState(null);
    let [getBedAssign, setBedAssign] = useState(null);

    useEffect(() => {
        var orgData = JSON.parse(window.localStorage.getItem("LOGINDATA"));
        orgData = orgData.loginInput.organization;
        setOrganizationId(orgData);
        //dispatch(getAllBedAssignment);
        HttpLogin.axios().get("api/dropdowns/get")
            .then((response) => {

                let wingInputData = response.data.map((i) => { return i.wing })
                setWingData(wingInputData[0]);
                let floorInputData = response.data.map((i) => { return i.floorNo })
                setFloorNumber(floorInputData[0]);
                let wardInputData = response.data.map((i) => { return i.wardName })
                setWardNumber(wardInputData[0]);
                let sideInputData = response.data.map((i) => { return i.side })
                setSideData(sideInputData[0]);
                let roomInputData = response.data.map((i) => { return i.roomNo })
                setRoomNumber(roomInputData[0]);
                let bedTypeInputData = response.data.map((i) => { return i.bedType })
                setBedTypeData(bedTypeInputData[0]);
                let bedNoInputData = response.data.map((i) => { return i.bedNo })
                setBedNumber(bedNoInputData[0]);
                let supervisionLevelInputData = response.data.map((i) => { return i.supervisionLevel })
                setSupervisionLevelData(supervisionLevelInputData[0]);
                let positionInputData = response.data.map((i) => { return i.position })
                setPositionData(positionInputData[0]);
            })
        HttpLogin.axios().get("/api/bedConfig/getAll")
            .then((resp) => {
                setBedAssign(resp.data.data);
            })
        let arrayIndex = [];
        for (var a = 1; a <= 20; a++) {

            arrayIndex.push(a);
        }
        setPositionIndex(arrayIndex);


    }, []);



    let newFloorInputData = floorNumber != null && floorNumber.length > 0 && floorNumber.map((item, i) => {
        return (
            <MenuItem key={i} value={item.id}>{item.value}</MenuItem>
        )
    })

    let newWingInputData = wingData != null && wingData.length > 0 && wingData.map((item, i) => {
        return (
            <MenuItem key={i} value={item.id}>{item.value}</MenuItem>
        )
    })

    let newWardInputData = wardNumber != null && wardNumber.length > 0 && wardNumber.map((item, i) => {
        return (
            <MenuItem key={i} value={item.id}>{item.value}</MenuItem>
        )
    })

    let newSideInputData = sideData != null && sideData.length > 0 && sideData.map((item, i) => {
        return (
            <MenuItem key={i} value={item.id}>{item.value}</MenuItem>
        )
    })


    let newBedTypeInputData = bedTypeData != null && bedTypeData.length > 0 && bedTypeData.map((item, i) => {
        return (
            <MenuItem key={i} value={item.id}>{item.value}</MenuItem>
        )
    })

    let newBedNoInputData = bedNumber != null && bedNumber.length > 0 && bedNumber.map((item, i) => {
        return (
            <MenuItem key={i} value={item.id}>{item.value}</MenuItem>
        )
    })

    let newSupervisionLevelInputData = supervisionLevelData != null && supervisionLevelData.length > 0 && supervisionLevelData.map((item, i) => {
        return (
            <MenuItem key={i} value={item.id}>{item.value}</MenuItem>
        )
    })

    let newPositionInputData = positionIndex != null && positionIndex.length > 0 && positionIndex.map((item, i) => {
        //console.log(JSON.stringify(roomNumber.map(t1 => ({ ...t1, ...getBedAssign.find(t2 => t2.side === inputFormData.side && t2.roomNo !== t1.id) }))))
        return (
            <MenuItem key={i} value={item.toString()}>{item.toString()}</MenuItem>
        )
    })

    const [organizationred, setorganizationred] = useState(false);
    const handleInputChange = (event: any) => {
        if (event.target.name === "floorNo") {
            inputFormData.floorNo = event.target.value;
        } else if (event.target.name === "WardunitName") {
            inputFormData.wardName = event.target.value;
        } else if (event.target.name === "wing") {
            inputFormData.wing = event.target.value;
        } else if (event.target.name === "side") {
            inputFormData.side = event.target.value;
            // HttpLogin.axios().get("/api/bedConfig/getAll")
            // .then((resp) => {
            //   console.log(JSON.stringify(resp.data.data.filter(i=>i.r)))
            // })
        } else if (event.target.name === "roomNo") {
            inputFormData.roomNo = event.target.value;
        } else if (event.target.name === "bedType") {
            inputFormData.bedType = event.target.value;
        } else if (event.target.name === "bedNo") {
            inputFormData.bedNo = event.target.value;
        } else if (event.target.name === "bedFeatures") {
            inputFormData.bedFeatures = event.target.value;
        } else if (event.target.name === "supervisionLevel") {
            inputFormData.supervisionLevel = event.target.value;
        } else if (event.target.id === "securityMeasures") {
            inputFormData.securityMeasures = (event.target.value);
        } else if (event.target.name === "Positions") {
            inputFormData.position = (event.target.value);
        } else if (event.target.id === "colorred") {
            setorganizationred(event.target.checked);
        }

        setInputFormData({ ...inputFormData });
    }
    /*
      const [isPageLoaded, setPageLoaded] = useState(false);
    
      if (!isPageLoaded && !createOrganizationData.isLoading) {
    
        if (createOrganizationData.items !== null && createOrganizationData.items !== "") {
    
          if (createOrganizationData.items.message !== undefined && createOrganizationData.items.message.code !== "MHC - 0200") {
            alert(createOrganizationData.items.message.description);
          } else {
            alert("Organization Created / Updated Sucessfully")
          }
        }
    
        // setInputOrgData(getByIdOrganizationData.items);
        setPageLoaded(true)
      }
      if (!createOrganizationData && createOrganizationData.isFormSubmit) {
    
        setTimeout(() => {
          setPageLoaded(false);
    
        }, (1000));
      }  */

    const [isValid, setValid] = useState(true);
    const checkValidation = () => {
        errorMessage = "";
        setValid(true);
        var email = /^\w+([\.-]?\w+)@\w+([\.-]?\w+)(\.\w{2,3})+$/i;
        var phoneno = /^\(\d{3}\) \d{3}-\d{4}$/;
        if ((inputFormData.floorNo == null || inputFormData.floorNo == "" || inputFormData.floorNo.length == 0)) {
            setValid(false);
            document.getElementById("floorNo").focus();
            errorMessage = "select the floor no";
            return false;
        } else if ((inputFormData.wing == null || inputFormData.wing == "" || inputFormData.wing!.length == 0)) {
            setValid(false);
            document.getElementById("wing").focus();
            errorMessage = "Select Wing";
            return false;
        } else if ((inputFormData.wardName == null || inputFormData.wardName == "" || inputFormData.wardName.length == 0)) {
            setValid(false);
            document.getElementById("WardunitName").focus();
            errorMessage = "Ward/Unit Name is Not a Valid";
            return false;
        } else if ((inputFormData.side == null || inputFormData.side == "" || inputFormData.side!.length == 0)) {
            setValid(false);
            document.getElementById("side").focus();
            errorMessage = "Select side";
            return false;
        } else if ((inputFormData.roomNo == null || inputFormData.roomNo == "" || inputFormData.roomNo!.length == 0)) {
            setValid(false);
            document.getElementById("roomNo").focus();
            errorMessage = "select roomNo";
            return false;
        } else if ((inputFormData.bedType == null || inputFormData.bedType == "" || inputFormData.bedType!.length == 0)) {
            setValid(false);
            document.getElementById("bedtypes").focus();
            errorMessage = "select bedType";
            return false;
        } else if ((inputFormData.bedNo == null || inputFormData.bedNo == "" || inputFormData.bedNo!.length == 0 || phoneno.test(inputFormData.bedNo))) {
            setValid(false);
            document.getElementById("bedNo").focus();
            errorMessage = "enter valid bed number";
            return false;
        } else if ((inputFormData.bedFeatures == null || inputFormData.bedFeatures == "" || inputFormData.bedFeatures!.length == 0)) {
            setValid(false);
            document.getElementById("bedFeatures").focus();
            errorMessage = "select bedFeatures ";
            return false;
        } else if ((inputFormData.supervisionLevel == null || inputFormData.supervisionLevel == "" || inputFormData.supervisionLevel!.length == 0)) {
            setValid(false);
            document.getElementById("supervisionLevel").focus();
            errorMessage = "select supervision level ";
            return false;
        } else if ((inputFormData.securityMeasures == null || inputFormData.securityMeasures == "" || inputFormData.securityMeasures!.length == 0)) {
            setValid(false);
            document.getElementById("securityMeasures").focus();
            errorMessage = "enter valid securityMeasures ";
            return false;
        } else if ((inputFormData.position == null || inputFormData.position == "" || inputFormData.position!.length == 0)) {
            setValid(false);
            document.getElementById("Positions").focus();
            errorMessage = "enter the positions ";
            return false;
        }
        else {
            setValid(true);
            return true;
        }

    }

    const handleClickChange = () => {
    //    console.log(JSON.stringify(inputFormData));
        setInputFormData({ ...inputFormData });
        dispatch(createBedAssignment(inputFormData));
        alert("Bed Assign Created");
        window.location.href = "/MettlerDynamicBedAssign";
    }

    return (
        <>
            <div className="bed-details" style={{ height: "1168px" }}>
                <div className="bed-details-child" />
                <div className="bed-details-child1" style={{ height: "1106px" }} />
                <div className="bedline-div" style={{ top: "155px" }} />
                <div className="bedexpand-more-24px-parent" style={{ top: "107px" }}>
                    <img
                        className="bedexpand-more-24px-icon"
                        alt=""
                        src="/expand-more-24px.svg"
                    />
                    <div className="beddetails"> <i style={{ position: "relative", top: "6px", left: "-7px" }} className="large material-icons">arrow_back</i>Add Procedure</div>
                </div>
                <div style={{ top: "6px", background:  '#2D56AD', height: '98px' , display: 'flex', width: 'calc(100% - 0px)', position: 'absolute', left: "0px" }} >
                    
                        <div id="mettlerEmptyPadding" className="p-col-12 p-md-1">
                            <img style={{ width: '60px', height: '60px', position: 'relative', left: '13px', top: '23px' }} src={AvatarBigImage}></img>
                        </div>
                        <div id="mettlerEmptyPadding" style={{ display: 'flex', flexDirection: 'column' }} className="p-col-12 p-md-6">
                            <div style={{ display: 'flex', flexDirection: 'row' }}>
                                <div style={{ position: 'relative', top: '19px', minWidth: 'max-content', fontSize: '18px' }} className="App-TopBar-PatientName">parthiban</div>
                                <div style={{ position: 'relative', top: '23px', left: '6px', minWidth: 'max-content', fontSize: '14px' }} className="App-TopBar-PatientAge"> Years</div>

                                <div className="admit-patient-ss" style={{ width: '105px', height: '24px', background: '#5574B7', border: '1px solid #5574B7', position: 'relative', top: '19px', left: '23px' }}>
                                    <div style={{ fontWeight: 400, fontSize: '12px', opacity: 0.6, color: '#FFF' }} className="admit-patient-profileName">SS#:</div>
                                    <div style={{ fontWeight: 400, fontSize: '12px', color: '#FFF' }} className="admit-patient-profileName">SS-</div>
                                </div>
                                <div className="admit-patient-ss" style={{ width: '110px', height: '24px', position: 'relative', left: '40px', top: '19px', background: '#5574B7', border: '1px solid #5574B7' }}>
                                    <div style={{ fontWeight: 400, fontSize: '12px', opacity: 0.6, color: '#FFF' }} className="admit-patient-profileName">MR:</div>
                                    <div style={{ fontWeight: 400, fontSize: '12px', color: '#FFF' }} className="admit-patient-profileName">MR-345</div>
                                </div>
                            </div>
                            <div style={{ display: 'flex', flexDirection: 'row' }}>
                                <div style={{ position: 'relative', top: '32px', display: 'flex' }} >
                                    <img style={{ width: '26px', height: '26px', position: 'relative', top: '8px', left: '5px', fontSize: '10px' }} src={bloodBag}></img>
                                    <span style={{ opacity: 0.6000000238418579, position: 'relative', left: '7px', top: '1px', fontSize: '10px' }} className="App-TopBar-BloodName">Blood</span>
                                    <span style={{ position: 'relative', top: '14px', left: '-22px', fontSize: '12px' }} className="App-TopBar-PatientValue">A</span><span style={{ position: 'relative', top: '13px', left: '-22px', fontSize: '12px' }} className="App-TopBar-PatientValue">+</span>
                                </div>
                                <div style={{ position: 'relative', top: '30px', left: '', display: 'flex' }}>
                                    <img style={{ width: '26px', height: '26px', position: 'relative', top: '10px', left: '5px', fontSize: '10px' }} src={bloodDrop}></img>
                                    <span style={{ opacity: 0.6000000238418579, position: 'relative', left: '6px', top: '5px', fontSize: '10px' }} className="App-TopBar-BloodName">Height</span>
                                    <span style={{ position: 'relative', top: '18px', left: '-25px', fontSize: '12px', width: '30px' }} className="App-TopBar-PatientValue">--</span>
                                </div>
                                <div style={{ position: 'relative', top: '30px', display: 'flex' }}>
                                    <img style={{ width: '26px', height: '26px', position: 'relative', top: '10px', left: '5px' }} src={bloodDropNew}></img>
                                    <span style={{ opacity: 0.6000000238418579, position: 'relative', left: '6px', top: '8px', fontSize: '10px' }} className="App-TopBar-BloodName">Weight</span>
                                    <span style={{ position: 'relative', top: '23px', left: '-29px', fontSize: '12px' }} className="App-TopBar-PatientValue">45kg</span>
                                </div>
                                <div style={{ position: 'relative', top: '30px', display: 'flex' }} >
                                    <img style={{ width: '26px', height: '26px', position: 'relative', top: '10px', left: '5px' }} src={bloodDropNewOne}></img>
                                    <span style={{ opacity: 0.6000000238418579, position: 'relative', left: '7px', top: '9px', fontSize: '10px' }} className="App-TopBar-BloodName">DOB</span>
                                    <span style={{ position: 'relative', top: '22px', left: '-13px', fontSize: '12px', width: '75px' }} className="App-TopBar-PatientValue"></span>
                                </div>
                                <div style={{ position: 'relative', top: '30px', left: '10px', display: 'flex' }}>
                                    <img style={{ width: '26px', height: '26px', position: 'relative', top: '10px', left: '5px' }} src={AvatarDoctorImage}></img>
                                    <span style={{ fontSize: '16px', position: 'relative', top: '11px', left: '13px', width: '200px' }} className="App-TopBar-PatientValue">Dr. Linda Blair, OP</span>
                                </div>
                            </div>
                        </div>
                        <div id="mettlerEmptyPadding" className="p-col-12 p-md-5">  </div>
                    
                </div>
                <LocalizationProvider dateAdapter={AdapterDateFns}>

                    <div className="bedorgForm-fields" style={{ top: "286px", display: "flex", flexDirection: "row-reverse" }}>
                        <DatePicker
                            className="name-input13"
                            label="Earliest appropriate date"
                            slotProps={{
                                textField: {
                                    variant: "outlined",
                                    size: "medium",

                                    color: "primary",
                                },
                            }}
                        />


                        <FormControl className="name-input13" variant="outlined">
                            <InputLabel color="primary" ><span >Service to problem this procedure
                            </span></InputLabel>
                            <Select color="primary" size="medium" label="Supervision Level" id="supervisionLevel" name="supervisionLevel" value={inputFormData.supervisionLevel} onChange={handleInputChange}>
                                <MenuItem value="1">Vital Unit1</MenuItem>
                                <MenuItem value="2">Vital Unit2</MenuItem>
                                <MenuItem value="3">Vital Unit3</MenuItem>
                            </Select>
                            <FormHelperText />
                        </FormControl>
                    </div>

                    <div className="bedorgForm-fields2" style={{ top: "433px" }}>
                        <div style={{ fontSize: "16px", fontWeight: "lighter", color: "#000000", position: "absolute", top: "-73px", left: "7px" }}>Patient will be seen as an</div>

                        <FormControl className="name-input13" variant="outlined">
                            <InputLabel color="primary" ><span >Place of Consultation
                            </span></InputLabel>
                            <Select color="primary" size="medium" label="Supervision Level" id="supervisionLevel" name="supervisionLevel" value={inputFormData.supervisionLevel} onChange={handleInputChange}>
                                <MenuItem value="1">Vital Unit1</MenuItem>
                                <MenuItem value="2">Vital Unit2</MenuItem>
                                <MenuItem value="3">Vital Unit3</MenuItem>
                            </Select>
                            <FormHelperText />
                        </FormControl>

                        <RadioGroup name="patientSocHisDrinkAlcohol"
                            style={{ position: "absolute", top: "-28px", left: "-6px" }}
                            row>
                            <div className="frame-parent7" style={{ color: 'darkslategray' }}>
                                <FormControlLabel
                                    className="radio-buttongray-icon2"
                                    label="Observed" value="Postal"
                                    labelPlacement="end"
                                    control={<Radio color="primary" size="medium" />}
                                />
                                <FormControlLabel
                                    style={{ left: "129px" }}
                                    className="radio-buttongray-icon3"
                                    label="Historical" value="Physical"
                                    labelPlacement="end"
                                    control={<Radio color="primary" size="medium" />}
                                />
                            </div>
                        </RadioGroup>
                        <TextField

                            className="name-input13"
                            color="primary"
                            variant="outlined"
                            type="text"
                            label="Provisional Diagnosis"
                            placeholder="Placeholder"
                            size="medium"
                            margin="none"
                        />

                    </div>
                    <div className="bedorgForm-fields2" style={{ top: "517px" }}>
                        

                        <FormControl className="name-input13" variant="outlined">
                            <InputLabel color="primary" ><span >Ordered by
                            </span></InputLabel>
                            <Select color="primary" size="medium" label="Ordered by" id="Orderedby" name="Orderedby" value={""} onChange={handleInputChange}>
                                <MenuItem value="1">Vital Unit1</MenuItem>
                                <MenuItem value="2">Vital Unit2</MenuItem>
                                <MenuItem value="3">Vital Unit3</MenuItem>
                            </Select>
                            <FormHelperText />
                        </FormControl>

                        
                        <FormControl className="name-input13" variant="outlined">
                            <InputLabel color="primary" ><span >Entered by
                            </span></InputLabel>
                            <Select color="primary" size="medium" label="Entered by" id="Entered by" name="Enteredby" value={""} onChange={handleInputChange}>
                                <MenuItem value="1">Vital Unit1</MenuItem>
                                <MenuItem value="2">Vital Unit2</MenuItem>
                                <MenuItem value="3">Vital Unit3</MenuItem>
                            </Select>
                            <FormHelperText />
                        </FormControl>

                    </div>


                    <div className="bedorgForm-fields3" style={{ position: "absolute", display: "flex", flexDirection: "column", top: "622px" }}>
                        <div style={{ fontWeight: "bold", fontSize: "16px", lineHeight: "24px", letterSpacing: "0.15px", color: "#000000" }}>Comments</div>
                        <div style={{ font: "poppins", fontWeight: "bold", fontSize: "15px", lineHeight: "22.5px", color: "#3F3F46" }}>Robert<span style={{ left: "12px", position: "relative", font: "poppins", fontWeight: "lighter", fontSize: "15px", lineHeight: "22.5px", color: "#9DA1C3" }}>Jun-25, 2021 at 17:13</span></div>
                        <div style={{ position: "relative", font: "poppins", fontWeight: "lighter", fontSize: "14px", lineHeight: "21px", color: "#172B4D" }}>The objective of genuine health care reform must be premium</div>
                        <div style={{ top: "52px", position: "relative", font: "poppins", fontWeight: "lighter", fontSize: "15px", lineHeight: "22.5px", color: "#3F3F46" }}>Add Comment</div>

                    </div>
                    <div className="bedorgForm-fields3" style={{ display: "flex", top: "813px" }}>
                        <TextField

                            className="name-input13"
                            color="primary"
                            variant="outlined"
                            type="text"

                            placeholder="Placeholder"
                            size="medium"
                            margin="none"
                        />
                        <div style={{ position: "absolute", left: "495px", top: "64px", gap: "23px", display: "flex" }} >
                            <div style={{ borderRadius: "4px", width: "40px", height: "40px", backgroundColor: "#E4EAF0", color: "#0000008A" }}><i className="large material-icons" style={{ position: "absolute", top: "9px", left: "7px" }} >close</i></div>
                            <div style={{ borderRadius: "4px", width: "40px", height: "40px", backgroundColor: "#133C93", color: "#FFFFFF", cursor: "pointer" }}><i className="large material-icons" style={{ position: "absolute", top: "9px", left: "68px" }}>check</i></div>
                        </div>
                    </div>

                    <div className="bedorgForm-fields8">

                        <FormControl className="name-input13" variant="outlined">
                            <InputLabel color="primary" ><span >Procedure
                            </span></InputLabel>
